func main() {
	// Create a map to store the hostnames and their resolved IPs
	hostnameIPMap := make(map[string][]string)

	// Create a listener for incoming DNS requests
	listener, err := net.Listen("udp", ":53")
	if err != nil {
		log.Fatal(err)
	}
	defer listener.Close()

	for {
		// Accept an incoming DNS request
		conn, err := listener.Accept()
		if err != nil {
			log.Fatal(err)
		}

		// Handle the DNS request
		go handleDNSRequest(conn, &hostnameIPMap)
	}
}

func handleDNSRequest(conn net.Conn, hostnameIPMap *map[string][]string) {
	// Read the DNS request from the connection
	buf := make([]byte, 1024)
	_, err := conn.Read(buf)
	if err != nil {
		log.Fatal(err)
	}

	// Parse the DNS request
	dnsRequest := strings.Split(string(buf), "\x00")
	question := strings.Split(dnsRequest[0], " ")

	// Resolve the hostname to an IP
	ip, err := resolveHostname(question[0])
	if err != nil {
		log.Println(err)
		return
	}

	// Create a DNS response
	dnsResponse := []byte{}
	dnsResponse = append(dnsResponse, []byte("\x00\x01")...)
	dnsResponse = append(dnsResponse, []byte(question[0])...)
	dnsResponse = append(dnsResponse, []byte("\x00\x01")...)
	dnsResponse = append(dnsResponse, []byte(ip)...)
	dnsResponse = append(dnsResponse, []byte("\x00")...)

	// Write the DNS response to the connection
	_, err = conn.Write(dnsResponse)
	if err != nil {
		log.Fatal(err)
	}

	// Store the hostname and its resolved IP in the map
	(*hostnameIPMap)[question[0]] = []string{ip}

	// Close the connection
	conn.Close()
}

